import 'bootstrap/dist/css/bootstrap.min.css';
import mapleLeaf from '../../../res/logo_maple.png';
import {Container, Form, Card, Row, Button, Image, Col} from 'react-bootstrap';
import ItemTopLocations from './ItemTopLocation';
import ScrollArea from 'react-scrollbar';

const TopLocations = () => {
  return (
    <div style={{marginTop: 250, height: 100, width: '100%'}}>
      <strong
        style={{
          margin: 30,
        }}
      >
        Top Locations
      </strong>
      <ScrollArea
        speed={0.8}
        className="scroll-area"
        contentClassName="scroll-content"
        minScrollSize={10}
        horizontalScrollbarStyle={{
          width: 10,
          height: 10,
          scrollbarColor: 'red',
        }}
        verticalScrollbarStyle={{
          width: 10,
          height: 10,
          scrollbarColor: 'red',
        }}
      >
        <ItemTopLocations />
        <ItemTopLocations />
        <ItemTopLocations />
        <ItemTopLocations />
        <ItemTopLocations />
        <ItemTopLocations />
        <ItemTopLocations />
        <ItemTopLocations />
        <ItemTopLocations />
      </ScrollArea>
    </div>
  );
};

export default TopLocations;
